import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './pages/Home';
import Reviews from './pages/Reviews';

function App() {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" exact component={Home} />
                <Route path="/reviews" exact component={Reviews} />
            </Switch>
        </BrowserRouter>
    );
}

export default App;
